import React from 'react'
import "./Dfile.scss"

import CloudDownloadIcon from '@material-ui/icons/CloudDownload';

import Button from "@material-ui/core/Button";
import ClearRoundedIcon from "@material-ui/icons/ClearRounded";

import { withStyles, makeStyles } from "@material-ui/core/styles";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";



const useStyles = makeStyles({
    table: {
        minWidth:"inherit",
    }
})


const row2 = [
    {
      Tax: "Modal-1",
      Money: <ClearRoundedIcon/>,
    },
  
    {
      Tax: "Modal-2",
      Money: "$600",
    },
    {
      Tax: "Modal-3",
      Money: "$200",
    },
    {
      Tax: "Modal-4",
      Money: "$900",
    },

  ];

const Dfile = () => {

    const classes = useStyles();
    return (
        <>


<div className="main_snd">
            <div className="snd_box">
              <TableContainer style={{ width: "400px" }} component={Paper}>
                <Table className={classes.table} aria-label="simple table">
                  <TableHead>
                    <TableRow>
                      <TableCell>Modal Name</TableCell>
                      <TableCell align="right">Download Modal</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {row2.map((row, index) => (
                      <TableRow key={index}>
                        <TableCell component="th" scope="row">
                          {row.Tax}
                        </TableCell>
                        <TableCell align="right">{row.Money}</TableCell>

                        <TableCell align="right">{row.fat}</TableCell>
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
              </TableContainer>
            </div>
          </div>




            
        </>
    )
}

export default Dfile
